import './App.css';
import React, { Component } from 'react'
import Navbar from './myComponent/Navbar';
import News from './myComponent/News';
import Footer from './myComponent/Footer';

export default class App extends Component {
  render() {
    return (
      <div>
        <Navbar/>
        <News/>
        <Footer/>
      </div>
    )
  }
}
